// GetL1DataFee
// OpSrource https://github.com/ethereum-optimism/optimism/blob/233ede59d16cb01bdd8e7ff662a153a4c3178bdd/packages/contracts/contracts/L2/predeploys/OVM_GasPriceOracle.sol#L109-L124
// l1Gas = zeros * TX_DATA_ZERO_GAS + (nonzeros + 4) * TX_DATA_NON_ZERO_GAS
// l1GasFee = ((l1Gas + overhead) * l1BaseFee * scalar) / PRECISION
func (executor EthereumExecutor) GetL1DataFee(data []byte) (*big.Int, error) {
	address, ok := conf.L1GasOracleInL2[executor.network]
	if !ok {
		return nil, xerrors.Errorf("L1GasOracleInL2 not found in network %s", executor.network)
	}

	contract, err := l1_gas_oracle.NewContract(address, executor.Client)
	if err != nil {
		return nil, err
	}

	abi, err := l1_gas_oracle.ContractMetaData.GetAbi()
	if err != nil {
		return nil, err
	}
	method := abi.Methods["getL1Fee"]
	input, err := method.Inputs.Pack(data)
	if err != nil {
		return nil, err
	}
	fee, err := contract.GetL1Fee(nil, input)
	if err != nil {
		return nil, err
	}
	return fee, nil
}

func (executor EthereumExecutor) SimulateV06HandleOp(v06 user_op.UserOpInput, entryPoint *common.Address) (*model.SimulateHandleOpResult, error) {
	abi, err := contract_entrypoint_v06.ContractMetaData.GetAbi()
	if err != nil {
		return nil, err
	}
	callData, err := abi.Pack("simulateHandleOp", &v06, global_const.EmptyAddress, []byte{})
	if err != nil {
		return nil, xerrors.Errorf("pack Arg ERROR [%v]", err)
	}
	if callData == nil {
		return nil, xerrors.Errorf("callData is nil")
	}
	client := executor.Client
	req := utils.EthCallReq{
		From: global_const.EmptyAddress,
		To:   *entryPoint,
		Data: callData,
	}
	callErr := client.Client().CallContext(context.Background(), nil, "eth_call", &req, "latest")
	logrus.Debugf("simulateHandleOp callErr :[%v]", callErr)
	simResult, simErr := contract_entrypoint_v06.NewExecutionResult(callErr)
	if simErr != nil {
		return nil, simErr
	}

	return &model.SimulateHandleOpResult{
		PreOpGas:               simResult.PreOpGas,
		GasPaid:                simResult.Paid,
		ValidAfter:             simResult.ValidAfter,
		ValidUntil:             simResult.ValidUntil,
		TargetSuccess:          simResult.TargetSuccess,
		TargetResult:           simResult.TargetResult,
		SimulateUserOpCallData: callData,
	}, nil
}

func (executor EthereumExecutor) SimulateV07HandleOp(userOpV07 user_op.UserOpInput, entryPoint *common.Address) (*model.SimulateHandleOpResult, error) {
	var result *simulate_entrypoint.IEntryPointSimulationsExecutionResult

	simulateAbi, err := simulate_entrypoint.ContractMetaData.GetAbi()
	if err != nil {
		return nil, err
	}

	callData, err := simulateAbi.Pack("simulateHandleOp", &userOpV07, global_const.EmptyAddress, []byte{})
	if err != nil {
		return nil, err
	}
	//client := executor.Client
	msg := ethereum.CallMsg{
		From: global_const.EmptyAddress,
		To:   entryPoint,
		Data: callData,
	}
	//callMsg := utils.ToCallArg(&msg)
	mapAcc := &map[common.Address]gethclient.OverrideAccount{
		*entryPoint: {
			Code: EntryPointSimulationsDeployCode,
		},
	}
	gClient := executor.GethClient
	byteResult, err := gClient.CallContractWithBlockOverrides(context.Background(), msg, nil, mapAcc, gethclient.BlockOverrides{})
	if err != nil {
		return nil, err
	}
	err = json.Unmarshal(byteResult, &result)
	if err != nil {
		return nil, err
	}
	return &model.SimulateHandleOpResult{
		PreOpGas:      result.PreOpGas,
		GasPaid:       result.Paid,
		TargetSuccess: result.TargetSuccess,
		TargetResult:  result.TargetResult,
	}, nil
}
