func (executor EthereumExecutor) GetAuth() (*bind.TransactOpts, error) {
	if executor.ChainId == nil {
		return nil, xerrors.Errorf("chainId is nil")
	}
	return GetAuth(executor.ChainId, global_const.DummyPrivateKey)
}
func GetAuth(chainId *big.Int, privateKey *ecdsa.PrivateKey) (*bind.TransactOpts, error) {
	signer := go_ethereum_types.LatestSignerForChainID(chainId)
	address := crypto.PubkeyToAddress(privateKey.PublicKey)
	return &bind.TransactOpts{
		From: address,
		Signer: func(address common.Address, tx *go_ethereum_types.Transaction) (*go_ethereum_types.Transaction, error) {
			if address != address {
				return nil, bind.ErrNotAuthorized
			}
			signature, err := crypto.Sign(signer.Hash(tx).Bytes(), privateKey)
			if err != nil {
				return nil, err
			}
			return tx.WithSignature(signer, signature)
		},
		Context: context.Background(),
	}, nil
}
func (executor EthereumExecutor) GetUserOpHash(userOp *user_op.UserOpInput, strategy *model.Strategy) ([]byte, string, error) {
	version := strategy.GetStrategyEntrypointVersion()
	erc20Token := common.HexToAddress("0x")
	paytype := strategy.GetPayType()
	if paytype == global_const.PayTypeERC20 {
		tokenType := strategy.GetUseToken()
		tokenAddress := conf.GetTokenAddress(strategy.GetNewWork(), tokenType)
		erc20Token = common.HexToAddress(tokenAddress)
	}

	if version == global_const.EntrypointV06 {
		contract, err := executor.GetPaymasterErc20AndVerifyV06(strategy.GetPaymasterAddress())
		if err != nil {
			return nil, "", err
		}
		conTractuserOp := paymater_verifying_erc20_v06.UserOperation{
			Sender:               *userOp.Sender,
			Nonce:                userOp.Nonce,
			InitCode:             userOp.InitCode,
			CallData:             userOp.CallData,
			CallGasLimit:         userOp.CallGasLimit,
			VerificationGasLimit: userOp.VerificationGasLimit,
			PreVerificationGas:   userOp.PreVerificationGas,
			MaxFeePerGas:         userOp.MaxFeePerGas,
			MaxPriorityFeePerGas: userOp.MaxPriorityFeePerGas,
			PaymasterAndData:     userOp.PaymasterAndData,
			Signature:            userOp.Signature,
		}
		jsonString, _ := json.Marshal(conTractuserOp)
		logrus.Debug("conTractuserOp:", string(jsonString))
		hash, err := contract.GetHash(&bind.CallOpts{}, conTractuserOp, strategy.ExecuteRestriction.EffectiveEndTime, strategy.ExecuteRestriction.EffectiveStartTime, erc20Token, big.NewInt(0))
		if err != nil {
			return nil, "", err
		}
		return hash[:], "", nil
	} else if version == global_const.EntryPointV07 {
		if paytype == global_const.PayTypeVerifying {
			contract, err := executor.GetPaymasterVerifyV07(strategy.GetPaymasterAddress())
			if err != nil {
				return nil, "", err
			}
			accountGasLimit := utils.PackIntTo32Bytes(userOp.VerificationGasLimit, userOp.CallGasLimit)
			gasFee := utils.PackIntTo32Bytes(userOp.MaxPriorityFeePerGas, userOp.MaxFeePerGas)
			hash, err := contract.GetHash(&bind.CallOpts{}, contract_paymaster_verifying_v07.PackedUserOperation{
				Sender:           *userOp.Sender,
				Nonce:            userOp.Nonce,
				InitCode:         userOp.InitCode,
				CallData:         userOp.CallData,
				AccountGasLimits: accountGasLimit,
				GasFees:          gasFee,
				PaymasterAndData: userOp.PaymasterAndData,
				Signature:        userOp.Signature,
			}, strategy.ExecuteRestriction.EffectiveEndTime, strategy.ExecuteRestriction.EffectiveStartTime)
			if err != nil {
				return nil, "", err
			}
			return hash[:], "", nil
		} else if paytype == global_const.PayTypeERC20 {
			//TODO
			panic("implement me")
			//contract, err := executor.GetPaymasterErc20V07(strategy.GetPaymasterAddress())
			//if err != nil {
			//	return nil, "", err
			//}
			//hash, err := contract.GetHash(&bind.CallOpts{}, contract_paymaster_e_v07.PackedUserOperation{}, strategy.ExecuteRestriction.EffectiveEndTime, strategy.ExecuteRestriction.EffectiveStartTime, erc20Token, big.NewInt(0))
			//if err != nil {
			//	return nil, "", err
			//}
			//return hash[:], "", nil

		} else {
			return nil, "", xerrors.Errorf("paytype %s not support", paytype)
		}
	} else {
		return nil, "", xerrors.Errorf("entrypoint version %s not support", version)
	}

}
func (executor EthereumExecutor) GetPaymasterData(userOp *user_op.UserOpInput, strategy *model.Strategy, paymasterDataInput *paymaster_data.PaymasterData) ([]byte, error) {
	userOpHash, _, err := executor.GetUserOpHash(userOp, strategy)
	if err != nil {
		logrus.Errorf("GetUserOpHash error [%v]", err)
		return nil, err
	}
	signer := conf.GetSigner(strategy.GetNewWork())
	signature, err := utils.GetSign(userOpHash, signer.PrivateKey)
	if err != nil {
		return nil, err
	}
	dataGenerateFunc := paymaster_pay_type.GetGenerateFunc(strategy.GetPayType())
	paymasterData, err := dataGenerateFunc(paymasterDataInput, signature)
	return paymasterData, err
}
